export const Main=styled.div`
width:100%;
display:flex;
justify-content: space-around;
background:black;
float: right;
text-align: end;
position: fixed;
bottom:0;
`

export const Div=styled.div`
// margin-left:5rem;
// margin-right:2rem;
color:#fff;
display: ${props => props.display}

